import React from 'react'
import './Home.css'

function Home() {
  return (
    <div className='home-div d-flex flex-row'>
      <img src="https://thumbs.dreamstime.com/b/d-small-people-checklist-person-image-white-background-32740005.jpg"/>
      <div><h1 className='home-text'>Create Your </h1>
      <h1 className='home-text'>Own Surveys</h1></div>
    </div>
  )
}

export default Home
